  \"2015-02-04T19:04:15.609467\",\n\t\"name\": \"housing-maintenance-code-complaints-2b7a3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Housing Preservation
  and Development (HPD) records complaints that are made by the public through the
  311 Citizen Services Center, Code Enforcement Borough Offices or the internet for
  conditions which violate the New York City Housing Maintenance Code (HMC) or the
  New York State Multiple Dwelling Law (MDL). Each complaint is associated with one
  or more problems reported by the complainant. Problems are closed if a tenant verifies
  by phone that the condition was corrected or an inspection result is entered by
  an HPD inspector. A complaint is closed when all associated problems are closed.\",\n\t\"license_title\":
